<script>
  (function(){
    const searchString = window.location.search.slice(1);
    if (searchString) {
      const searchList = searchString.split('&')
      const searchObj = {}
      searchList.forEach(item => {

          const itList = item.split('=');
          searchObj[itList[0]] = decodeURI(itList[1])
      })

      if (searchObj.company) {
        const companyEl =  document.getElementById('company')
        companyEl.innerHTML = searchObj.company
      }
    }
  })()
</script>
